pt-BR	cataloging.bibliographic.automatic_holding_help	<p>Utilize os campos abaixo para acelerar o processo de catalogao de exemplares. O preenchimento  opcional e nenhum exemplar ser criado caso nenhum campo seja preenchido. Neste caso, voc poder criar exemplares manualmente, com o formulrio completo, pela aba <em>Exemplares</em>.</p><p>Caso seja do seu interesse cadastrar exemplares agora, o nico campo que precisa sempre ser preenchido  o Nmero de Exemplares. Para cada volume da obra sero criados esta quantidade selecionada de exemplares, portanto, se o registro bibliogrfico possuir 3 volumes e voc preencher o Nmero de Exemplares com o nmero 2 e o Nmero de Volumes da Obra com o nmero 3, sero criados 6 exemplares, 2 para o Volume 1, 2 para o Volume 2 e 2 para o Volume 3. Caso os exemplares sejam de apenas um volume, preencha o campo Nmero do Volume, e, caso a obra no tenha volumes, deixe ambos os campo em branco.</p>	2014-07-05 17:20:32.670746	1	2014-07-05 17:20:32.670746	1	f
