es	cataloging.bibliographic.automatic_holding_help	<p>Utilice los campos abajo para acelerar el proceso de catalogacin de ejemplares. El rellenado es opcional y no se crear ningn ejemplar en caso de no se rellene ningn campo. En este caso, usted podr crear ejemplares manualmente, con el formulario completo, por la pestaa <em>Exemplares</em>.</p><p>En caso de ser de su inters registrar ejemplares ahora, el nico campo que precisa ser rellenado siempre es el Nmero de Ejemplares. Para cada volumen de la obra se crear esta cantidad seleccionada de ejemplares, por lo tanto si el registro bibliogrfico posee 3 volmenes y usted rellena el Nmero de Ejemplares con el nmero 2 y el Nmero de Volmenes de la Obra con el nmero 3, se crearn 6 ejemplares, 2 para el Volumen 1, 2 para el Volumen 2 y 2 para el Volumen 3. En caso de que los ejemplares sean de solamente un volumen, rellene el campo Nmero del Volumen, y, en caso de que la obra no tenga volmenes, deje ambos campos en blanco.</p>	2014-07-19 11:28:46.69376	1	2014-07-19 11:28:46.69376	1	f
