es	search.bibliographic.page_help	<p>La bsqueda bibliogrfica permite recuperar informaciones sobre los registros del acervo de esta biblioteca, enlistando sus ejemplares, campos catalogrficos y archivos digitales.</p>\n<p>La forma ms simple es usar la <strong>bsqueda simplificada</strong>, que tratar de encontrar cada uno de los trminos digitados en los siguientes campos: <em>{0}</em>.</p>\n<p>Las palabras son buscadas en su forma completa, pero es posible usar el caracter asterisco (*) para buscar por palabras incompletas, de modo que la bsqueda <em>'brasil*'</em> encuentre registros que contengan <em>'brasil'</em>, <em>'brasilia'</em> y <em>'brasilero'</em>, por ejemplo. Los pares de comillas pueden ser usados para encontrar dos palabras en secuencia, de modo que la bsqueda <em>"mi amor"</em> encuentre registros que contengan las dos palabras juntas, pero no encuentre registros con el texto <em>'mi primer amor'</em>.</p>\n<p>La <strong>bsqueda avanzada</strong> otorga un mayor control sobre los registros localizados, permitiendo, por ejemplo, buscar por fecha de catalogacin o exactamente en el campo deseado.</p>	2014-07-19 11:28:46.69376	1	2014-07-19 11:28:46.69376	1	f
