pt-BR	cataloging.labels.page_help	<p>O mdulo <strong>"Impresso de Etiquetas"</strong> permite gerar as etiquetas de identificao interna e de lombada para os exemplares da biblioteca.</p>\n<p> possvel gerar as etiquetas de um ou mais exemplares em uma nica impresso, utilizando a pesquisa abaixo. Fique atento ao detalhe de que o resultado desta pesquisa  uma lista de exemplares e no de registros bibliogrficos.</p>\n<p>Aps encontrar o(s) exemplare(s) de interesse, use o boto <strong>"Selecionar exemplar"</strong> para adicion-los  lista de impresso de etiquetas. Voc poder fazer diversas pesquisas, sem perder a seleo feita anteriormente. Quando finalmente estiver satisfeito com a seleo, clique no boto <strong>"Imprimir etiquetas"</strong>. Ser possvel selecionar qual modelo da folha de etiquetas a ser usado e de qual posio iniciar.</p>	2014-06-14 19:34:08.805257	1	2014-06-14 19:34:08.805257	1	f
