pt-BR	search.authorities.page_help	<p>A pesquisa de autoridades permite recuperar informaes sobre os autores presentes no acervo desta biblioteca, caso catalogados.</p>\n<p>A pesquisa buscar cada um dos termos digitados nos seguintes campos: <em>{0}</em>.</p>\n<p>As palavras so pesquisadas em sua forma completa, porm  possvel usar o caractere asterisco (*) para buscar por palavras incompletas, de modo que a pesquisa <em>'brasil*'</em> encontre registros que contenham <em>'brasil'</em>, <em>'brasilia'</em> e <em>'brasileiro'</em>, por exemplo. Aspas duplas podem ser usadas para encontrar duas palavras em sequncia, de modo que a pesquisa <em>"meu amor"</em> encontre registros que contenham as duas palavras juntas, mas no encontre registros com o texto <em>'meu primeiro amor'</em>.</p>	2014-06-14 19:34:08.805257	1	2014-06-14 19:34:08.805257	1	f
