pt-BR	administration.user_type.page_help	<p>A rotina de Tipos de Usurios permite o cadastramento e pesquisa dos Tipos de Usurios utilizados pela rotina de Cadastro de Usurios. Aqui so definidas informaes como Limite de Emprstimos simultneos, prazos para devoluo de emprstimos e valores de multas dirias para cada tipo de usurio separadamente.</p>\n<p>Ao acessar essa rotina, o Biblivre listar automaticamente todos os Tipos de Usurios previamente cadastrados.  Voc poder ento filtrar essa lista, digitando o <em>Nome</em> de um Tipo de Usurio que queira encontrar.</p>	2014-06-14 19:34:08.805257	1	2014-06-14 19:34:08.805257	1	f
