pt-BR	administration.configuration.description.general.backup_path	Esta configurao representa o caminho, no servidor onde o Biblivre est instalado, para a pasta onde devero ser guardados as cpias de segurana do Biblivre. Caso esta configurao estiver vazia, as cpias de segurana sero gravadas no diretrio <strong>Biblivre</strong> dentro da pasta do usurio do sistema.<br>Recomendamos que este caminho esteja associado a algum tipo de backup automtico em nvem, como os servios <strong>Dropbox</strong>, <strong>SkyDrive</strong> ou <strong>Google Drive</strong>. Caso o Biblivre no consiga guardar os arquivos no caminho especificado, os mesmos sero guardados em um diretrio temporrio e podero ficar indisponveis com o tempo. Lembre-se, um backup  a nica forma de recuperar os dados inseridos no Biblivre.	2014-06-14 19:34:08.805257	1	2014-06-14 19:34:08.805257	1	f
