pt-BR	administration.brief_customization.page_help	<p>A rotina de Personalizaao de Resumo Catalogrfico permite configurar quais campos e subcampos MARC sero apresentados nas rotinas de Catalogao Bibliogrfica, de Autoridades e de Vocabulrios.  Os campos e subcampos configurados aqui sero apresentados na aba de Resumo Catalogrfico nas rotinas de Catalogao. Voc poder configurar a ordem dos campos e subcampos, assim como os separadores que iro aparecer entre os subcampos.</p><p>Os campos exibidos nesta tela so os campos disponveis no Formulrio Catalogrfico. Para criar novos campos, ou alterar seus subcampos, utilize a tela de <b>Personalizao de Formulrio Catalogrfico.</b></p>	2022-12-04 11:05:55.480318	0	2022-12-04 11:05:55.480318	0	f
en-US	administration.brief_customization.page_help	<p>The Catalographic Summary Customization page lets you customize which MARC Tags and Subfields will be displayed in the Cataloging pages. The Tags and Subfields customized in this page will be displayed in the Catalographic Summary tabs in the Cataloging pages. You can customize the order for the Tags and Subfields, and also customize the separators or aggregators for the Subfields.</p><p>All the Tags and Subfields displayed here are the ones available in the Catalographic Form page. To create new Tags or Subfields, go to the <b>Catalographic Form Customization</b> page.</p>	2022-12-04 11:05:55.480955	0	2022-12-04 11:05:55.480955	0	f
es	administration.brief_customization.page_help	<p>La pgina Personalizacin de lo Resumen Catalogrfico le permite personalizar cual Campos y Subcampos MARC se mostrarn en las pginas de Catalogacin. Los Campos y Subcampos personalizados en esta pgina se mostrarn en las fichas de lo Resumen catalogrfico en las pginas de Catalogacin. Usted puede personalizar el orden de los Campos y Subcampos, y tambin personalizar los separadores o agregadores del subcampos.</p><p>Todas los Campos y Subcampos que se muestra aqu son los que estn disponibles en la pgina de Formulario Catalogrfico. Para crear nuevas etiquetas o subcampos, vaya a la <b>Personalizacin del Formulario Catalogrfico</b>.</p>	2022-12-04 11:05:55.48153	0	2022-12-04 11:05:55.48153	0	f
