pt-BR	administration.translations.edit.description	<p>Abaixo voc pode editar as tradues sem ter que baixar o arquivo. Esta tela  ideal para rpidas alteraes em textos do Biblivre. O idioma exibido abaixo  o mesmo que est atualmente em uso. Para editar as tradues de outro idioma, troque o idioma atual do Biblivre por outro no topo da pgina. Caso voc tenha personalizado seu Biblivre na tela de Personalizacao, voc precisar ajustar os nomes dos campos criados para todos os idiomas instalados. Para facilitar nesse trabalho, clique na caixa "Exibir apenas os campos sem traduo".</p><p>Voc pode tambm adicionar um novo idioma diretamente nesta tela. Para tanto, basta alterar o valor do campo "language_code".</p>	2022-12-04 11:05:55.531143	0	2022-12-04 11:05:55.531143	0	f
