pt-BR	multi_schema.translations.page_help	<p>O mdulo de <strong>"Tradues"</strong> de Multi-bibliotecas funciona de forma anloga a sua verso de uma nica biblioteca, porm, textos alterados por aqui sero aplicados a todas as bibliotecas do grupo, desde que estas no tenham alterado o valor original de cada traduo.</p>\n<p>Por exemplo, se voc alterar a traduo da chave <strong>"menu.search"</strong> de "Pesquisa" para "Busca" pelo mdulo de tradues multi-bibliotecas, todas as bibliotecas deste grupo vero a nova traduo. Porm, se um dos administradores de uma destas bibliotecas alterar, atravs do mdulo de <strong>"Tradues"</strong> de sua biblioteca, a mesma chave para "Procurar", esta traduo interna ter prioridade, apenas para esta biblioteca.</p>\n<p>Para adicionar um novo idioma, baixe o arquivo de idioma em Portugus, faa a traduo dos textos e depois faa o envio do arquivo. Lembre-se que apenas os <strong>textos</strong> (depois do sinal de igual) devem ser alterados.  No altere as chaves, ou o BIBLIVRE 5 no conseguir localizar o texto</p>\n<p>Exemplo: digamos que voc queira alterar o texto no menu principal de <i>Pesquisa</i> para <i>Busca</i>.  Voc dever ento baixar o arquivo do idioma e alterar a seguinte linha:</p>\n<p><strong>*menu.search</strong> = Pesquisa</p>\n<p>Para:</p>\n<p><strong>*menu.search</strong> = Busca</p>\n<p>E ento fazer o Envio do arquivo de idiomas. O BIBLIVRE 5 ir processar o arquivo, e alterar o texto do menu.</p>	2014-06-21 11:54:49.572182	1	2022-12-04 11:05:55.5474	1	f
