pt-BR	administration.configuration.description.logged_out_text	Texto que ser exibido na tela inicial do Biblivre, para usurios que no tenham entrado com login e senha. Voc pode usar tags HTML, mas cuidado para no quebrar o layout do BIBLIVRE 5. Ateno: esta configurao est relacionada com o sistema de tradues. Alteraes feitas nesta tela afetaro somente o idioma atual. Para alterar em outros idiomas, use a tela de tradues ou acesse o Biblivre usando o idioma a ser alterado.	2014-07-12 11:21:42.419959	1	2022-12-04 11:05:55.5474	1	f
