es	administration.maintenance.backup.description.3	El Backup sin archivos digitales es una copia de todos los datos e informaciones del BIBLIVRE 5, <strong>excluyendo</strong> los archivos de medio digital. Por excluir los archivos de medio digital, el proceso tanto de backup cuanto de recuperacin es ms rpido, y el archivo de backup es menor.	2014-07-19 11:28:46.69376	1	2022-12-04 11:05:55.5474	1	f
