es	administration.configuration.description.logged_out_text	Texto a ser exhibido en la pantalla del Biblivre, para usuarios que no tengan ingresado con login y contrasea. Usted puede utilizar tags HTML, pero cuidado de no quebrar el diseo del BIBLIVRE 5. Atencin: esta configuracin se relaciona con el sistema de traducciones. Las alteraciones realizadas en esta pantalla afectarn solamente el idioma actual. Para alterar en otros idiomas, utilice la pantalla de traducciones o acceda al Biblivre utilizando el idioma a ser alterado.	2014-07-19 11:28:46.69376	1	2022-12-04 11:05:55.5474	1	f
