es	administration.translations.page_help	<p>El mdulo de <strong>"Traducciones"</strong> permite agregar nuevos idiomas al BIBLIVRE 5 o alterar los textos ya existentes.</p>\n<p><strong>Atencin: Este mdulo realiza configuraciones avanzadas del BIBLIVRE 5, y debe ser utilizado solamente por Usuarios avanzados, con experiencia en informtica.</strong>.</p>\n<p>Para agregar un nuevo idioma, baje el archivo de idioma en portugus, haga la traduccin de los textos y despus enve el archivo. Recuerde que solamente los <strong>textos</strong> (despus del signo igual) deben ser alterados.  No altere las llaves, caso contrario el BIBLIVRE 5 no conseguir localizar el texto</p>\n<p>Ejemplo: digamos que usted quiera alterar el texto en el men principal de <i>Bsqueda</i> para <i>Buscar</i>.  Usted deber entonces bajar el archivo del idioma y alterar la siguiente lnea:</p>\n<p><strong>*menu.search</strong> = Bsqueda</p>\n<p>Para:</p>\n<p><strong>*menu.search</strong> = Busca</p>\n<p>Y entonces hacer el envo del archivo de idiomas. El BIBLIVRE 5 procesar el archivo, y alterar el texto del men.</p>	2014-07-19 11:28:46.69376	1	2022-12-04 11:05:55.5474	1	f
