es	multi_schema.translations.page_help	<p>El mdulo de <strong>"Traducciones"</strong> de Multibibliotecas funciona de forma anloga a su versin de una nica biblioteca, no obstante, los textos alterados aqu se aplicarn a todas las bibliotecas del grupo, siempre que estas no hayan alterado el valor original de cada traduccin.</p>\n<p>Por ejemplo, si usted altera la traduccin de la llave <strong>"menu.search"</strong> de "Bsqueda" para "Busca" por el mdulo de traducciones multibibliotecas, todas las bibliotecas de este grupo vern la nueva traduccin. Sin embargo, si uno de los administradores de una de estas bibliotecas alterara, a travs del mdulo de <strong>"Traducciones"</strong> de su biblioteca, la misma llave para "Procurar", esta traduccin interna tendr prioridad, solamente para esta biblioteca.</p>\n<p>Para agregar un nuevo idioma, baje el archivo de idioma en Portugus, realice la traduccin de los textos y despus enve el archivo. Recuerde que solamente los <strong>textos</strong> (despus del signo igual) deben ser alterados.  No altere las llaves, o el BIBLIVRE 5 no conseguir localizar el texto</p>\n<p>Ejemplo: digamos que usted quiera alterar el texto en el men principal de <i>Bsqueda</i> para <i>Busca</i>.  Usted deber entonces bajar el archivo de idioma y alterar la siguiente lnea:</p>\n<p><strong>*menu.search</strong> = Bsqueda</p>\n<p>Para:</p>\n<p><strong>*menu.search</strong> = Busca</p>\n<p>Y entonces hacer el Envo de archivo de idiomas. El BIBLIVRE 5 procesar el archivo, y alterar el texto del men.</p>	2014-07-19 11:28:46.69376	1	2022-12-04 11:05:55.5474	1	f
