en-US	administration.translations.page_help	<p> The module <strong>"Translations"</strong> allows adding new languages to BIBLIVRE 5 or modifying existing texts.</p>\n<p><strong>Attention: this module performs advanced configurations in BIBLIVRE 5, and needs to be used solely by advanced Users, experienced in IT.</strong>.</p>\n<p>To add a new language, please download the Portuguese language file, do the translation of the texts and then send the file. Remember that only the <strong>texts</strong> (after the = sign) must be translated. Do not modify the keys; if you do so, BIBLIVRE 5 will not be able to find the text </p>\n<p>Example: lets imagine that you wish to modify the text in the main menu of <i>Search</i> to <i>Look for</i>. You will then have to download the language file and modify the following line:</p>\n<p><strong>*menu.search</strong> = Search</p>\n<p>To:</p>\n<p><strong>*menu.search</strong> = Loo for</p>\n<p>And then deliver the language file. BIBLIVRE 5 will process the file and will modify the menu text.</p>	2014-07-26 10:56:18.338867	1	2022-12-04 11:05:55.5474	1	f
