en-US	multi_schema.translations.page_help	<p>The module of <strong>"Translations"</strong> for Multilibraries Works similarly to the version corresponding to just one library. However, texts which were modified here will be applied to all the libraries in the group, provided they have not modified the original value of each translation.</p>\n<p>For example, if you modify the translation of the key <strong>"menu.search"</strong> from "Search" to "Trace" through the Translations module for multi-libraries, all the libraries in this group will see the new translation. However, if one of the administrators of one of these libraries modifies, through the <strong>"Translations"</strong> module of his library, the same key to "Search", this in-house translation will have priority just for this library.</p>\n<p>In order to add a new language, you will have to download the language file in Portuguese, do the translation of the texts and then upload the file. Remember that only the <strong>texts</strong> (after the = sign) must be modified.  Do not modify the keys, as otherwise the BIBLIVRE 5 will not be able to trace the text </p>\n<p>Example: Lets say that you wish to modify the text in the main menu from <i>Search</i> to <i>Trace</i>.  You will have to download the language file and modify this line:</p>\n<p><strong>*menu.search</strong> = Search</p>\n<p>To:</p>\n<p><strong>*menu.search</strong> = Trace</p>\n<p>and then upload the language file. BIBLIVRE 5 will process the file and will modify the menu text.</p>	2014-07-26 10:56:18.338867	1	2022-12-04 11:05:55.5474	1	f
