es	text.main.logged_in	<p>Hola {0},</p>\n<p>Sea bienvenido a la <strong>Biblioteca Libre (Biblivre) vERSIN 5.0</strong>.</p>\n<p>Usted podr hacer bsquedas por registros bibliogrficos, autoridades y vocabulario con la opcin <em>"Bsqueda"</em> en el men superior. Esta es la misma <em>"Bsqueda"</em> que los lectores podrn usar al accesar al <strong>Biblivre</strong>, sin necesidad de usuario y contrasea, para buscar por registros en la Base Principal.</p>\n<p>Para registrar lectores, realizar prstamos, devoluciones y reservas, controlar el acceso a la biblioteca e imprimir carnets, use la opcin <em>"Circulacin"</em>, tambin en el men superior.</p>\n<p>En la opcin <em>"Catalogacin"</em>, usted podr controlar el acervo de la biblioteca, catalogando obras y ejemplares, y efectuar el control de autoridades y de vocabulario. A travs de esta opcin tambin es posible imprimir las etiquetas usadas en los ejemplares, mover registros entre las bases de datos (Principal, Trabajo, Privada y Papelera de reciclaje), importar y exportar registros y agregar archivos digitales a los registros existentes.</p>\n<p>El <strong>Biblivre</strong> tambin posee un sistema simple de control del proceso de adquisicin, para auxiliar la compra y recibimiento de publicaciones, a travs de la opcin <em>"Adquisicin"</em>.</p>\n<p>En <em>"Administracin"</em>, usted podr cambiar la contrasea de acceso, configurar recursos del <strong>Biblivre</strong> como campos de los formularios, traducciones y tipos de usuario, registrar tarjetas de acceso, generar informes y realizar la manutencin de la base de datos, que incluye la generacin de la copia de seguridad (backup), y la Reindizacin de la base de datos, que debe ser usada cuando algunos registros no pueden ser encontrados a travs de la bsqueda.</p>\n<p>En caso que precise de ms informaciones sobre el <strong>Biblivre</strong>, accese a la opcin <em>"Ayuda"</em> y lea el Manual del programa o las preguntas frecuentes, en <a href="http://biblivre.org.br/forum" target="_blank">Frum</a>.</p>	2014-07-19 11:28:46.69376	1	2022-12-04 11:05:55.5474	1	f
es	text.main.logged_out	<p>El programa <strong>Biblioteca Libre (Biblivre) vERSIN 5.0</strong> es un aplicativo que permite la inclusin digital del ciudadano en la sociedad de la informacin. Sepa ms sobre el proyecto en <em>"Sobre"</em>, en la opcin <em>"Ayuda"</em> en el men superior.</p>\n<p>Se trata de un programa para catalogacin y difusin de acervos de bibliotecas pblicas y privadas, de variados portes, adems de posibilitar la circulacin y el compartir contenidos de informacin, tales como, textos, msicas, imgenes y pelculas o cualquier otro tipo de objeto digital.</p>\n<p>Hoy, el <strong>Biblivre</strong> es un xito en todo Brasil, as como en el exterior y, por su extrema relevancia cultural, se viene asentando como el aplicativo de eleccin para la inclusin digital del ciudadano.</p>\n<p>Si desea solamente buscar el catlogo y accesar a las obras disponibles digitalmente, utilize la opcin <em>"Bsqueda"</em> en el men superior, sin la necesidad de usuario y contrasea.</p>\n<p>Para otros servicios, tales como circulacin, catalogacin, adquisicin y administracin, es necesario un nombre de <strong>usuario</strong> y <strong>contrasea</strong>.</p>	2014-07-19 11:28:46.69376	1	2022-12-04 11:05:55.5474	1	f
en-US	administration.maintenance.backup.description.3	Backup without digital files is a copy of all the BIBLIVRE 5 data and information, <strong>excluding</strong> digital media files. In view of the exclusion of digital media files, the backup and retrieval processes are faster, and the backup file is smaller.	2014-07-26 10:56:18.338867	1	2022-12-04 11:05:55.5474	1	f
